import fs from "fs-extra";
import path from "path";
import md5 from "md5";

import sidebar from "../helpers/sidebar";
import { randomNumber } from "../helpers/libs";
import { Image, Comment } from "../models";

export const index = async(req, res) => {
    let viewModel = { image: {}, comments: [] };
    const image = await Image.findOne({
        filename: { $regex: req.params.image_id },
    });
    if (image) {
        image.views = image.views + 1;
        viewModel.image = image;
        image.save();
        const comments = await Comment.find({ image_id: image._id }).sort({
            timestamp: 1,
        });
        viewModel.comments = comments;
        viewModel = await sidebar(viewModel);
        res.render("image", viewModel);
    } else {
        res.redirect("/");
    }
};

export const create = (req, res) => {
    const saveImage = async() => {
        const imgUrl = randomNumber();
        const images = await Image.find({ filename: imgUrl });
        if (images.length > 0) {
            saveImage();
        } else {
            // Image Location
            const imageTempPath = req.file.path;
            const ext = path.extname(req.file.originalname).toLowerCase();
            const targetPath = path.resolve(`./uploads/${imgUrl}${ext}`);

            // Validate Extension
            if (
                ext === ".png" ||
                ext === ".jpg" ||
                ext === ".jpeg" ||
                ext === ".gif"
            ) {
                // you wil need the public/temp path or this will throw an error
                await fs.rename(imageTempPath, targetPath);

                // create a new image
                const newImg = new Image({
                    title: req.body.title,
                    filename: imgUrl + ext,
                    description: req.body.description,
                });

                // save the image
                const imageSaved = await newImg.save();

                // redirect to the list of images
                res.redirect("/images/" + imageSaved.uniqueId);
            } else {
                await fs.unlink(imageTempPath);
                res.status(500).json({ error: "Solo se permiten imágenes" });
            }
        }
    };

    saveImage();
};

export const like = async(req, res) => {
    const image = await Image.findOne({
        filename: { $regex: req.params.image_id },
    });
    console.log(image);
    if (image) {
        image.likes = image.likes + 1;
        await image.save();
        res.json({ likes: image.likes });
    } else {
        res.status(500).json({ error: "Error Interno" });
    }
};

export const comment = async(req, res) => {
    const image = await Image.findOne({
        filename: { $regex: req.params.image_id },
    });
    if (image) {
        const newComment = new Comment(req.body);
        newComment.gravatar = md5(newComment.email);
        newComment.image_id = image._id;
        await newComment.save();
        res.redirect("/images/" + image.uniqueId + "#" + newComment._id);
    } else {
        res.redirect("/");
    }
};

export const remove = async(req, res) => {
    const image = await Image.findOne({
        filename: { $regex: req.params.image_id },
    });
    if (image) {
        await fs.unlink(path.resolve("./uploads/" + image.filename));
        await Comment.deleteOne({ image_id: image._id });
        await image.remove();
        res.json(true);
    } else {
        res.json({ response: "Solicitud incorrecta." });
    }
};

